CREATE TABLE `Despesa` (
	`Id` INT(11) NOT NULL AUTO_INCREMENT,
	`Empresa_Nome` VARCHAR(250) NULL DEFAULT NULL COLLATE 'latin1_swedish_ci',
	`Empresa_Segmento` VARCHAR(250) NULL DEFAULT NULL COLLATE 'latin1_swedish_ci',
	`Empresa_Logradouro` VARCHAR(250) NULL DEFAULT NULL COLLATE 'latin1_swedish_ci',
	`Empresa_Bairro` VARCHAR(250) NULL DEFAULT NULL COLLATE 'latin1_swedish_ci',
	`Empresa_Cidade` VARCHAR(250) NULL DEFAULT NULL COLLATE 'latin1_swedish_ci',
	`Empresa_Estado` VARCHAR(250) NULL DEFAULT NULL COLLATE 'latin1_swedish_ci',
	`Produto_Nome` VARCHAR(250) NULL DEFAULT NULL COLLATE 'latin1_swedish_ci',
	`Produto_Tipo` VARCHAR(250) NULL DEFAULT NULL COLLATE 'latin1_swedish_ci',
	`Produto_Marca` VARCHAR(250) NULL DEFAULT NULL COLLATE 'latin1_swedish_ci',
	`Produto_Descricao` VARCHAR(250) NULL DEFAULT NULL COLLATE 'latin1_swedish_ci',
	`Complemento` VARCHAR(250) NULL DEFAULT NULL COLLATE 'latin1_swedish_ci',
	`Forma_Pagamento` VARCHAR(250) NULL DEFAULT NULL COLLATE 'latin1_swedish_ci',
	`Quantidade` FLOAT NULL DEFAULT NULL,
	`Unidade` VARCHAR(250) NULL DEFAULT NULL COLLATE 'latin1_swedish_ci',
	`Valor_Unitario` FLOAT NULL DEFAULT NULL,
	`Valor_Total` FLOAT NULL DEFAULT NULL,
	`Data` DATE NULL DEFAULT NULL,
	`Hora` TIME NULL DEFAULT NULL,
	PRIMARY KEY (`Id`) USING BTREE
)
COLLATE='latin1_swedish_ci'
ENGINE=InnoDB
AUTO_INCREMENT=1;


